void init()
{
    QueryBuildDataSource qbds;
    QueryBuildRange      qbr;

    super();

    qbds = this.query().dataSourceTable(tableNum(InventFiscalLIFOJournalTrans));
    qbr = qbds.addRange(fieldnum(InventFiscalLIFOJournalTrans,ItemGroup));
    qbr.value(queryValue(ItemGroup::GroupId));
